import style from "./Dialogs.module.css";
import Dialog from "./DialogItem/DialogItem";
import Message from "./MessageItem/MessageItem";

const Dialogs = (props) => {
  console.log(props);
  let DialogsElements = props.data.dialogs.map(dialog => (<Dialog name={dialog.name} id={dialog.id}/>) )
  let Messages = props.data.messages.map( message => (<Message text={message.text}/>) )

  return (
    <div className={style.main}>
      <h2>Диалоги:</h2>
      <div className={style.dialog_menu}>
        <div className={style.dialog_items}>
        {DialogsElements}
        </div>
        <div className={style.message_items}>
          {Messages}
        </div>
      </div>
    </div>
  );
};

export default Dialogs;
